import React from "react";
import "./About.scss";
function About(props) {
  return (
    <>
      <div className="about">
        <div className="wrapper__about"></div>
        <div className="about__logo">
          <img
            className="img-fluid"
            src="https://img.freepik.com/premium-vector/syml-logo10_19856-317.jpg"
            alt=""
          />
        </div>
      </div>
    </>
  );
}

export default About;
